let raw = items[0].json.output;

// Si viene con bloques ```json, extraer solo el contenido
const match = raw.match(/```json\s*([\s\S]*?)\s*```/);
if (match) {
  raw = match[1];
}

// Intentamos parsear el contenido
let parsed;
try {
  parsed = JSON.parse(raw);
} catch (err) {
  throw new Error("Error al parsear el JSON: " + err.message);
}

return [{ json: parsed }];
